import React, { useState, useEffect } from "react";
import axios from "axios";
import { useNavigate } from "react-router-dom"; // For navigation after time up

function Game() {
  const [question, setQuestion] = useState("");
  const [answer, setAnswer] = useState("");
  const [userAnswer, setUserAnswer] = useState("");
  const [feedback, setFeedback] = useState("");
  const [difficulty, setDifficulty] = useState("Easy");
  const [timeLeft, setTimeLeft] = useState(30);
  const [score, setScore] = useState(0);
  const [showTimeUpPopup, setShowTimeUpPopup] = useState(false); // Time's Up Popup State
  const navigate = useNavigate(); // To navigate after time's up

  useEffect(() => {
    fetchQuestion();
  }, [difficulty]);

  useEffect(() => {
    if (timeLeft === 0) {
      setFeedback("Time's up! ‚ùå");
      setShowTimeUpPopup(true); // Show Time's Up Popup
    }
    const timer = timeLeft > 0 && setInterval(() => setTimeLeft((t) => t - 1), 1000);
    return () => clearInterval(timer);
  }, [timeLeft]);

  const fetchQuestion = async () => {
    try {
      setTimeLeft(difficulty === "Easy" ? 30 : difficulty === "Medium" ? 20 : 10); // Set timer based on difficulty
      const res = await axios.get("http://localhost:5000/api/banana");
      setQuestion(res.data.question);
      setAnswer(res.data.solution);
      setFeedback("");
    } catch (err) {
      console.error("Error fetching question", err);
    }
  };

  const checkAnswer = () => {
    if (parseInt(userAnswer) === parseInt(answer)) {
      setFeedback("Correct! üéâ");
      setScore(score + 10);
      saveScore(); // Save the score when the user gets a correct answer
    } else {
      setFeedback("Wrong! ‚ùå");
    }
    setUserAnswer("");
    fetchQuestion();
  };

  const saveScore = async () => {
    try {
      const token = localStorage.getItem("token"); // Get user's auth token
      await axios.post(
        "http://localhost:5000/api/score/save",
        { userId: localStorage.getItem("userId"), score, difficulty },
        { headers: { Authorization: token } }
      );
      console.log("Score saved successfully");
    } catch (err) {
      console.error("Error saving score", err);
    }
  };

  const handlePlayAgain = () => {
    setScore(0);
    setShowTimeUpPopup(false); // Hide the time's up popup
    setTimeLeft(difficulty === "Easy" ? 30 : difficulty === "Medium" ? 20 : 10); // Reset the timer
    fetchQuestion(); // Fetch a new question
  };

  return (
    <div>
      <h2>Math Game</h2>
      <label>Choose Difficulty: </label>
      <select value={difficulty} onChange={(e) => setDifficulty(e.target.value)}>
        <option value="Easy">Easy</option>
        <option value="Medium">Medium</option>
        <option value="Hard">Hard</option>
      </select>

      <p>Time Left: {timeLeft}s</p>
      <p>Score: {score}</p>

      <img src={question} alt="Math Question" style={{ maxWidth: "300px" }} />

      <input
        type="number"
        value={userAnswer}
        onChange={(e) => setUserAnswer(e.target.value)}
        disabled={showTimeUpPopup} // Disable input after time's up
      />
      <button onClick={checkAnswer} disabled={showTimeUpPopup}>
        Submit
      </button>

      <p>{feedback}</p>

      {/* Time's Up Popup */}
      {showTimeUpPopup && (
        <div className="popup">
          <h3>Time's Up! ‚ùå</h3>
          <p>Do you want to play again?</p>
          <button onClick={handlePlayAgain}>Play Again</button>
          <button onClick={() => navigate("/mainmenu")}>Main Menu</button>
        </div>
      )}
    </div>
  );
}

export default Game;
